import React from 'react' 

import {Container , Row , Button} from 'reactstrap'
import {NavLink , Link} from 'react-router-dom'
import logo from "../../assets/images/logo.png"


const nav_links=[
    {
        path: '/home',
        display: 'Home'
    },
    {
        path: '#',
        display: 'About'
    },
    {
        path: '/tours',
        display: 'Tours'
    },
]

const Header = () => {
    return <header className="header">
        <Container>
            <Row>
                <div className="nav__wrapper d-flex align-items-centejustify-content-between">
                    {/*======== logo ============ */}
                       <div className="logo">
                          <img src={logo} alt="" />
                       </div>
                    {/*======== logo ============ */}
                </div>
            </Row>
        </Container>
    </header>
};

export default Header;
